// frontend/src/components/Layout/Layout.tsx
import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import './Layout.css';

interface LayoutProps {
  children: React.ReactNode;
}

const Layout: React.FC<LayoutProps> = ({ children }) => {
  const [sidebarOpen, setSidebarOpen] = useState(true);
  const location = useLocation();

  const menuItems = [
    { path: '/dashboard', label: 'ÎåÄÏãúÎ≥¥Îìú', icon: 'ÔøΩÔøΩ' },
    { path: '/ai-recommendation', label: 'AI Í∂åÍ≥†Ïïà', icon: 'ÔøΩÔøΩ' },
    { path: '/approval', label: 'ÏäπÏù∏ ÌîÑÎ°úÏÑ∏Ïä§', icon: '‚úÖ' },
    { path: '/log-audit', label: 'Î°úÍ∑∏ Î∞è Í∞êÏÇ¨', icon: 'üìã' }
  ];

  return (
    <div className="layout">
      <div className={`sidebar ${sidebarOpen ? 'open' : 'closed'}`}>
        <div className="sidebar-header">
          <div className="logo">
            <div className="logo-icon">üö®</div>
            {sidebarOpen && (
              <div className="logo-text">
                <h2>ÏÇ∞Î∂à ÎåÄÏùë AI</h2>
                <p>ÎØø:Ïùå 2.0</p>
              </div>
            )}
          </div>
          <button 
            className="sidebar-toggle"
            onClick={() => setSidebarOpen(!sidebarOpen)}
          >
            {sidebarOpen ? '‚óÄ' : '‚ñ∂'}
          </button>
        </div>
        <nav className="sidebar-nav">
          {menuItems.map(item => (
            <Link
              key={item.path}
              to={item.path}
              className={`nav-item ${location.pathname === item.path ? 'active' : ''}`}
            >
              <div className="nav-icon">{item.icon}</div>
              {sidebarOpen && <span className="nav-label">{item.label}</span>}
            </Link>
          ))}
        </nav>
        {sidebarOpen && (
          <div className="sidebar-footer">
            <div className="system-info">
              <div className="status-indicator active"></div>
              <span>ÏãúÏä§ÌÖú Ï†ïÏÉÅ</span>
            </div>
          </div>
        )}
      </div>
      
      <div className="main-content">
        <header className="header">
          <div className="header-left">
            <div className="breadcrumb">
              <span className="breadcrumb-item">Ìôà</span>
              <span className="breadcrumb-separator">/</span>
              <span className="breadcrumb-current">
                {menuItems.find(item => item.path === location.pathname)?.label || 'ÎåÄÏãúÎ≥¥Îìú'}
              </span>
            </div>
          </div>
          <div className="header-right">
            <div className="header-actions">
              <div className="notification-bell">
                <span className="bell-icon">üîî</span>
                <div className="notification-badge">3</div>
              </div>
              <div className="user-info">
                <div className="user-avatar">üë®‚Äçüíº</div>
                <div className="user-details">
                  <span className="user-name">Í¥ÄÎ¶¨Ïûê</span>
                  <span className="user-role">ÏãúÏä§ÌÖú Í¥ÄÎ¶¨Ïûê</span>
                </div>
              </div>
            </div>
          </div>
        </header>
        
        <main className="content">
          {children}
        </main>
      </div>
    </div>
  );
};

export default Layout;
